  constructor(){
    this.state={
      students:null
    }
  }
  componentDidMount(){
    callAPI().then(data=>{
      console.log(data);

      this.setState({
        students:data.students
      })
    })
  }
  render() {
    return (
      <div className="page">
      {this.state.students && console.log(this.state.students)
      }
      </div>
    );
  }
}

export default App;
